import React, { Component,useContext } from 'react'
import './flowerlist.css';
import {mainContext} from './../../../../context/mainContext';
import {withRouter} from 'react-router-dom';
 const Flowerlist=(props)=>{
    const {menu,changemenu,menuname,changemenuname,changedrawer}=useContext(mainContext)
    const laleh=()=>{
        changedrawer()
        props.history.push("/flower")
    }
     return(
         
        <div>
        <button onClick={()=>laleh()} className="menulistbutton">
            <text>گل لاله</text>
        </button>
        <button onClick={()=>laleh()} className="menulistbutton">
            <text>گل نرگس</text>
        </button>
</div> 
     )
 }
 export default withRouter(Flowerlist) ;
